import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
import CreateAndEditUser from './components/CreateAndEditUser'


const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/create-user">
            <CreateAndEditUser />
          </Route>
          <Route path="/view-user">
            <h1>view user</h1>
          </Route>
          <Route path="/edit-user">
            <h1>Edit user</h1>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
export default App;
